import React, { Component } from "react";
import Particles from 'react-particles-js';
import Typical from 'react-typical';

class Profile extends Component {
  render() {
    return (
      <section class="custom-profile">
        <Particles
    params={{
	    "fps_limit": 28,
	    "particles": {
	        "number": {
	            "value": 200,
	            "density": {
	                "enable": false
	            }
	        },
	        "line_linked": {
	            "enable": true,
	            "distance": 30,
	            "opacity": 0.4
	        },
	        "move": {
	            "speed": 1
	        },
	        "opacity": {
	            "anim": {
	                "enable": true,
	                "opacity_min": 0.05,
	                "speed": 2,
	                "sync": false
	            },
	            "value": 0.4
	        }
	    },
	    "polygon": {
	        "enable": true,
	        "scale": 0.5,
	        "type": "inline",
	        "move": {
	            "radius": 10
	        },
	        "url": "/small-deer.2a0425af.svg",
	        "inline": {
	            "arrangement": "equidistant"
	        },
	        "draw": {
	            "enable": true,
	            "stroke": {
	                "color": "rgba(255, 255, 255, .2)"
	            }
	        }
	    },
	    "retina_detect": false,
	    "interactivity": {
	        "events": {
	            "onhover": {
	                "enable": true,
	                "mode": "bubble"
	            }
	        },
	        "modes": {
	            "bubble": {
	                "size": 6,
	                "distance": 40
	            }
	        }
	    }
	}} />
        <div class="bg-overlay">
          <div class="home-table">
            <div class="home-table-center">
              <div class="container">
                <div class="row justify-content-center">
                  <div class="col-lg-12">
                    <div class="text-white text-center">
                      <h1 class="header_title mb-0 mt-3"> I am{' '}
                        <Typical
                          loop={Infinity}
                          wrapper='b'
                          steps={[
                            'Jae Kim.', 4000,
                            'a Developer.', 4000,
                            'a Designer.', 4000,
                            'a Blogger.', 4000
                          ]}
                        />
                      </h1>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div class="social_bar">
          <ul class="social_home">
            <li class="list-inline-item"><a href="https://www.facebook.com/kjw9149"><i
              class="fa fa-facebook"></i></a></li>
            <li class="list-inline-item"><a href="https://www.linkedin.com/in/jaeungkim0526"><i
              class="fa fa-linkedin"></i></a></li>
            <li class="list-inline-item"><a href="https://www.instagram.com/jaekiim/"><i
              class="fa fa-instagram"></i></a></li>
            <li class="list-inline-item"><a href="https://github.com/jaeungkim/"><i
              class="fa fa-github"></i></a></li>
          </ul>
        </div>
        <div class="scroll_down">
          <a href="#about" class="scroll">
            <i class="fa fa-arrow-down text-white"></i>
          </a>
        </div>
      </section>

    );
  }
}
export default Profile;
